import { style } from "typestyle"


const QuizFormStyle = style({
    backgroundColor: 'red',
    height: '100vh',
    $nest: {
        '& .navbar': {
            display:'flex',
            justifyContent: 'space-between',
            padding: '10px 50px',
            height: '100px',
            borderBottom: 'solid #00FF52 5px'
        }
    }
})
export default QuizFormStyle
